import React from 'react'
import bgImage from "..//images/comming_soon.jpg"
import { Button } from 'react-bootstrap';

function HomePage() {
  return (
    <div className='home'>
        <img src={bgImage} />
        <Button>ボタン</Button>
    </div>
  )
}

export default HomePage
